import { Routes, Route, useLocation, useNavigate } from "react-router-dom";
import AppLayout from '../AppLayout';
import Main from '../Main/Main';

function App() {
  return (
    <div className="page">
      <div>
        <AppLayout>
          <div></div>
        </AppLayout>
      </div>
      <Routes>
        <Route
          path="/"
        />
      </Routes>
    </div>
  );
}

export default App;
